import '../blocks/button/button.css';

export default function Button({text, handleClick}) {

  let onClick = (e) => {
    e.preventDefault();
    handleClick();
  }

  return (
    <button 
      className='button'
      onClick={onClick}
    >
      {text}
    </button>
  )
}
